PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE accounts (    id INTEGER PRIMARY KEY AUTOINCREMENT,    name TEXT NOT NULL UNIQUE, type TEXT NOT NULL DEFAULT 'CASH' CHECK(type IN ('CASH','CHECKING','SAVINGS','CREDIT_CARD','PHYSICAL_ASSET','INVESTMENT')), card_last4 TEXT);
CREATE TABLE categories (    id INTEGER PRIMARY KEY AUTOINCREMENT,    name TEXT NOT NULL,    type TEXT NOT NULL CHECK(type IN ('EXPENSE', 'INCOME')),    parent_id INTEGER,    UNIQUE(name, parent_id),    FOREIGN KEY (parent_id) REFERENCES categories(id));
CREATE TABLE transactions (    id INTEGER PRIMARY KEY AUTOINCREMENT,    amount_cents INTEGER NOT NULL,    type TEXT NOT NULL CHECK(type IN ('EXPENSE', 'INCOME', 'TRANSFER')),    account_id INTEGER NOT NULL,    category_id INTEGER,    date TEXT NOT NULL,    description TEXT,    transfer_id INTEGER,    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, payee TEXT, reflection_date TEXT,    FOREIGN KEY (account_id) REFERENCES accounts(id),    FOREIGN KEY (category_id) REFERENCES categories(id));
CREATE TABLE budgets (    id INTEGER PRIMARY KEY AUTOINCREMENT,    category_id INTEGER NOT NULL,    month TEXT NOT NULL,    limit_cents INTEGER NOT NULL,    UNIQUE(category_id, month),    FOREIGN KEY (category_id) REFERENCES categories(id));
PRAGMA writable_schema=ON;
CREATE TABLE IF NOT EXISTS sqlite_sequence(name,seq);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_transactions_date ON transactions(date);
CREATE INDEX idx_transactions_category ON transactions(category_id);
CREATE INDEX idx_transactions_account ON transactions(account_id);
CREATE INDEX idx_transactions_transfer ON transactions(transfer_id);
CREATE INDEX idx_budgets_month ON budgets(month);
CREATE INDEX idx_categories_parent ON categories(parent_id);
CREATE INDEX idx_transactions_effective_date ON transactions(COALESCE(reflection_date, date));
PRAGMA writable_schema=OFF;
COMMIT;
